},{"id":"479089"},{"id":"479090"},{"id":"479091"},{"id":"479092"},{"id":"479093"},{"id":"479094"},{"id":"479095"},{"id":"479096"},{"id":"479097"},{"id":"479098"},{"id":"479099"},{"id":"479100"},{"id":"479101"},{"id":"479102"},{"id":"479103"},{"id":"479104"},{"id":"479105"},{"id":"479106"},{"id":"479107"},{"id":"479108"},{"id":"479109"},{"id":"479110"},{"id":"479111"},{"id":"479112"},{"id":"479113"},{"id":"479114"},{"id":"479115"}],"distribution_select":{"id":"479717"},"num_sets_slider":{"id":"479718"},"process_select":{"id":"479716"}},"code":"\n\n    function rnormal() {\n            var u = 0, v = 0;\n            while(u === 0) u = Math.random(); \n            while(v === 0) v = Math.random();\n            return Math.sqrt( -2.0 * Math.log( u ) ) * Math.cos( 2.0 * Math.PI * v );\n        }\n\n    function sum(nums) {\n      var accumulator = 0;\n      for (var i = 0, l = nums.length; i &lt; l; i++)\n        accumulator += nums[i];\n      return accumulator;\n    }\n\n    function rbeta(alpha, beta) {\n      var alpha_gamma = rgamma(alpha, 1);\n      return alpha_gamma / (alpha_gamma + rgamma(beta, 1));\n    }\n\n    var SG_MAGICCONST = 1 + Math.log(4.5);\n    var LOG4 = Math.log(4.0);\n\n    function rgamma(alpha, beta) {\n      if (alpha &gt; 1) {\n        var ainv = Math.sqrt(2.0 * alpha - 1.0);\n        var bbb = alpha - LOG4;\n        var ccc = alpha + ainv;\n\n        while (true) {\n          var u1 = Math.random();\n          if (!((1e-7 &lt; u1) &amp;&amp; (u1 &lt; 0.9999999))) {\n            continue;\n          }\n          var u2 = 1.0 - Math.random();\n          var v = Math.log(u1/(1.0-u1))/ainv;\n          var x = alpha*Math.exp(v);\n          var z = u1*u1*u2;\n          var r = bbb+ccc*v-x;\n          if (r + SG_MAGICCONST - 4.5*z &gt;= 0.0 || r &gt;= Math.log(z)) {\n            return x * beta;\n          }\n        }\n      }\n      else if (alpha == 1.0) {\n        var u = Math.random();\n        while (u &lt;= 1e-7) {\n          u = Math.random();\n        }\n        return -Math.log(u) * beta;\n      }\n      else { \n        while (true) {\n          var u3 = Math.random();\n          var b = (Math.E + alpha)/Math.E;\n          var p = b*u3;\n          if (p &lt;= 1.0) {\n            var x = Math.pow(p, (1.0/alpha));\n          }\n          else {\n            var x = -Math.log((b-p)/alpha);\n          }\n          var u4 = Math.random();\n          if (p &gt; 1.0) {\n            if (u4 &lt;= Math.pow(x, (alpha - 1.0))) {\n              break;\n            }\n          }\n          else if (u4 &lt;= Math.exp(-x)) {\n            break;\n          }\n        }\n        return x * beta;\n      }\n    }\n    \n    function rdirichlet(alpha) {\n      var gammas = [];\n      for (var i = 0, l = alpha.length; i &lt; l; i++)\n        gammas.push(rgamma(alpha[i], 1));\n        \n      var accum = sum(gammas)\n      \n      for (var i = 0, l = gammas.length; i &lt; l; i++)\n        gammas[i] = gammas[i]/accum\n      return gammas\n    }\n\n    function rcauchy() {\n      return rnormal() / rnormal();\n    }\n\n\n    function rbernoulli(p) {\n      if (Math.random() &lt; p)\n        return 1\n      else\n        return 0\n    }\n    \n    function rcategorical(pi){\n      var u = Math.random();\n      var k = 0\n      var cum = pi[0]\n      for (var i = 1, l = pi.length; i &lt; l; i++)\n        if (u &lt;= cum){\n            break;\n        }\n        else{\n            cum = cum + pi[i]\n            k = k+1\n        }\n      return k\n    }\n\n  function rpoisson(lambda) {\n    var L = Math.exp(-lambda);\n    var k = 0;\n    var p = 1;\n    do {\n      k++;\n      p *= Math.random();\n    } while (p &gt; L);\n    return k - 1;\n  }\n\n      \n    \n    const selectedProcess = process_select.value;\n    const selectedDistribution = distribution_select.value;\n    const numSets = num_sets_slider.value;\n    const numSamples = 2000;  // Number of integers on the x-axis\n    const dt = 1/numSamples * 4;\n    const sqrt_dt = Math.sqrt(dt);\n    const xValues = Array.from({ length: numSamples }, (_, i) =&gt; i);  // Array of integers from 0 to 100\n    \n    for (let set = 0; set &lt; numSets; set++) {\n        const x = xValues.slice();  // Clone the x-values array\n        const y = [];  // Create a new array for y\n                    \n        if (selectedDistribution === \"Normal\") {\n            // Generate iid noise with a normal distribution\n            var rand = function(){ return rnormal()*sqrt_dt};\n        }\n        else if (selectedDistribution === \"Poisson\") {\n            // Generate iid noise with a poisson distribution\n            var rand = function(){ return rpoisson(dt)};\n        }\n        else if (selectedDistribution === \"Cauchy\") {\n            // Generate iid noise with a cauchy distribution\n            var rand = function(){ return rcauchy()*sqrt_dt};\n        }\n                    \n        \n\n        if (selectedProcess === \"l\u00e9vy\") {\n            // Generate random walk\n            let currentValue = 0;\n            for (let i = 0; i &lt; numSamples; i++) {\n                currentValue += rand();\n                y.push(currentValue);\n            }\n        } else if (selectedProcess === \"polynomial\") {\n            // Generate  random polynomial\n            let xi1, xi2, xi3, xi4, xi5;  // Declare variables here\n\n            if (selectedDistribution === \"Normal\") {\n                xi1 = rnormal()*10;\n                xi2 = rnormal()*5;\n                xi3 = rnormal()*2;\n                xi4 = rnormal()*2;\n                xi5 = rnormal();\n            }\n            else if (selectedDistribution === \"Poisson\") {\n                xi1 = rpoisson(1);\n                xi2 = rpoisson(1);\n                xi3 = rpoisson(1);\n                xi4 = rpoisson(1);\n                xi5 = rpoisson(1);\n            }\n            else if (selectedDistribution === \"Cauchy\") {\n                xi1 = rcauchy()*10;\n                xi2 = rcauchy()*5;\n                xi3 = rcauchy()*2;\n                xi4 = rcauchy()*2;\n                xi5 = rcauchy();\n            }\n\n            let currentValue = 0;\n            let t = 0;\n            for (let i = 0; i &lt; numSamples; i++) {\n                t = dt * i;\n                currentValue = xi1 + xi2 * t + xi3 * t**2 + xi4 * t**3\n                y.push(currentValue);\n            }\n        }\n        \n        // Assign the new x and y arrays to the data source\n        if (data_sources[set]) {\n            data_sources[set].data.x = x;\n            data_sources[set].data.y = y;\n            data_sources[set].change.emit();\n        }\n    }\n                    \n    // Remove the extra data sources\n    for (let set = numSets; set &lt; data_sources.length; set++) {\n        if (data_sources[set]) {        \n            data_sources[set].data.x = [];\n            data_sources[set].data.y = [];\n            data_sources[set].change.emit();\n        }\n    }\n"},"id":"479719","type":"CustomJS"},{"attributes":{"line_alpha":0.1,"line_color":"#64c639","line_width":2,"x":{"field":"x"},"y":{"field":"y"}},"id":"479256","type":"Line"},{"attributes":{"data":{"x":{"__ndarray__":"AAAAAAAAAABHvab2ZmRgP0e9pvZmZHA/6hv6cZqWeD9Hvab2ZmSAP5lsULSAfYQ/6hv6cZqWiD88y6MvtK+MP0e9pvZmZJA/8JR71fNwkj+ZbFC0gH2UP0JEJZMNipY/6hv6cZqWmD+T885QJ6OaPzzLoy+0r5w/5aJ4DkG8nj9Hvab2ZmSgPxspEWataqE/8JR71fNwoj/EAOZEOnejP5lsULSAfaQ/bdi6I8eDpT9CRCWTDYqmPxawjwJUkKc/6hv6cZqWqD+/h2Th4JypP5PzzlAno6o/aF85wG2pqz88y6MvtK+sPxE3Dp/6ta0/5aJ4DkG8rj+6DuN9h8KvP0e9pvZmZLA/MfNbLornsD8bKRFmrWqxPwZfxp3Q7bE/8JR71fNwsj/ayjANF/SyP8QA5kQ6d7M/rzabfF36sz+ZbFC0gH20P4OiBeyjALU/bdi6I8eDtT9XDnBb6ga2P0JEJZMNirY/LHrayjANtz8WsI8CVJC3PwDmRDp3E7g/6hv6cZqWuD/VUa+pvRm5P7+HZOHgnLk/qb0ZGQQguj+T885QJ6O6P34phIhKJrs/aF85wG2puz9Sle73kCy8PzzLoy+0r7w/JgFZZ9cyvT8RNw6f+rW9P/tsw9YdOb4/5aJ4DkG8vj/P2C1GZD+/P7oO432Hwr8/UiLMWtUiwD9Hvab2ZmTAPzxYgZL4pcA/MfNbLornwD8mjjbKGynBPxspEWatasE/EcTrAT+swT8GX8ad0O3BP/v5oDliL8I/8JR71fNwwj/lL1ZxhbL
